import React from "react";
import { Router,Routes,Route } from "react-router-dom";
import Nav from "./Nav"
 function App(){
    return(
       <>
       <Routes>
        <Route path='/' element={<Nav/>}></Route>
       </Routes>
       
       </>

    )
 }

 export default App;
